                  rtxDListAllocNodeAndData (pctxt, ProductId, &pnode, &pdata2);

                  if (pnode == NULL)
                     return LOG_RTERR (pctxt, RTERR_NOMEM);

                  asn1Init_ProductId (pdata2);

