int XmlDec_Payment (OSCTXT* pctxt, Payment* pvalue)
{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("payerPartyReference"), 19}, 0}, 0 },
      {{{OSUTF8("paymentAmount"), 13}, 0}, 1 },
      {{{OSUTF8("paymentDate"), 11}, 0}, 2 },
      {{{OSUTF8("adjustedPaymentDate"), 19}, 0}, 3 },
      {{{OSUTF8("paymentType"), 11}, 0}, 4 },
      {{{OSUTF8("settlementInformation"), 21}, 0}, 5 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 1, -1}, {1, 1, -1}, {2, 4, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 6; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: {
         rtXmlpMarkLastEventActive (pctxt);

         stat = XmlDec_PayerReceiver_model (pctxt, &pvalue->payerReceiver_model
            );
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 1: { /* paymentAmount */
         stat = XmlDec_Money_derivations (pctxt, &pvalue->paymentAmount);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 2: { /* paymentDate */
         stat = XmlDec_AdjustableDate (pctxt, &pvalue->paymentDate);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.paymentDatePresent = TRUE;
         break;
      }
      case 3: { /* adjustedPaymentDate */
         stat = rtXmlpDecDynUTF8Str (pctxt, (const OSUTF8CHAR**)&pvalue->
            adjustedPaymentDate);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.adjustedPaymentDatePresent = TRUE;
         break;
      }
      case 4: { /* paymentType */
         stat = XmlDec_PaymentType (pctxt, &pvalue->paymentType);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.paymentTypePresent = TRUE;
         break;
      }
      case 5: { /* settlementInformation */
         stat = XmlDec_SettlementInformation (pctxt, &pvalue->
            settlementInformation);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.settlementInformationPresent = TRUE;
         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

