      case 4:
         /* decode firstPeriodStartDate */
         if (XD_PEEKTAG (pctxt, 0x84)) {
            stat = xd_Tag1AndLen (pctxt, &length);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = asn1D_AdjustableDate (pctxt, 
               &pvalue->firstPeriodStartDate, ASN1IMPL, length);
            if (stat == 0) {
               pvalue->m.firstPeriodStartDatePresent = TRUE;
               if (length == ASN_K_INDEFLEN) {
                  if (XD_MATCHEOC (pctxt)) XD_BUMPIDX (pctxt, 2);
                  else return LOG_RTERR (pctxt, ASN_E_INVLEN);
               }
            }
         }
