            stat = asn1D_ClearanceSystem (pctxt, 
               &pvalue->clearanceSystem, ASN1IMPL, length);
            if (stat == 0) {
               pvalue->m.clearanceSystemPresent = TRUE;
               if (length == ASN_K_INDEFLEN) {
                  if (XD_MATCHEOC (pctxt)) XD_BUMPIDX (pctxt, 2);
                  else return LOG_RTERR (pctxt, ASN_E_INVLEN);
               }
            }
