int XmlDec_ConvertibleBond (OSCTXT* pctxt, ConvertibleBond* pvalue)
{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("instrumentId"), 12}, 0}, 0 },
      {{{OSUTF8("description"), 11}, 0}, 1 },
      {{{OSUTF8("currency"), 8}, 0}, 2 },
      {{{OSUTF8("exchangeId"), 10}, 0}, 3 },
      {{{OSUTF8("clearanceSystem"), 15}, 0}, 4 },
      {{{OSUTF8("relatedExchangeId"), 17}, 0}, 5 },
      {{{OSUTF8("issuerName"), 10}, 0}, 6 },
      {{{OSUTF8("couponRate"), 10}, 0}, 7 },
      {{{OSUTF8("maturity"), 8}, 0}, 8 },
      {{{OSUTF8("parValue"), 8}, 0}, 9 },
      {{{OSUTF8("faceAmount"), 10}, 0}, 10 },
      {{{OSUTF8("underlyingEquity"), 16}, 0}, 11 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 12, -1}, {12, 0, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 12; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: {
         InstrumentId* pdata1;
         do {
            pdata1 = rtxMemAllocType (pctxt, InstrumentId);

            if (pdata1 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_InstrumentId (pdata1);

            stat = XmlDec_InstrumentId (pctxt, pdata1);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = rtXmlpMatchEndTag (pctxt, -1);
            if (stat < 0) return LOG_RTERR (pctxt, stat);

            rtxDListAppend (pctxt, &pvalue->instrumentId_list, (void*)pdata1);

            stat = rtXmlpGetNextElemID (pctxt, elemtab + 0, 1, -1, FALSE);
            if (stat < 0 && stat != RTERR_UNEXPELEM)
               return LOG_RTERR (pctxt, stat);
         }
         while (stat == 0);

         rtXmlpMarkLastEventActive (pctxt);
         stat = 0;
         break;
      }
      case 1: { /* description */
         stat = rtXmlpDecDynUTF8Str (pctxt, &pvalue->description);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.descriptionPresent = TRUE;
         break;
      }
      case 2: { /* currency */
         stat = XmlDec_Currency (pctxt, &pvalue->currency);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.currencyPresent = TRUE;
         break;
      }
      case 3: { /* exchangeId */
         stat = XmlDec_ExchangeId (pctxt, &pvalue->exchangeId);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.exchangeIdPresent = TRUE;
         break;
      }
      case 4: { /* clearanceSystem */
         stat = XmlDec_ClearanceSystem (pctxt, &pvalue->clearanceSystem);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.clearanceSystemPresent = TRUE;
         break;
      }
      case 5: {
         ExchangeId* pdata1;
         do {
            pdata1 = rtxMemAllocType (pctxt, ExchangeId);

            if (pdata1 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_ExchangeId (pdata1);

            stat = XmlDec_ExchangeId (pctxt, pdata1);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = rtXmlpMatchEndTag (pctxt, -1);
            if (stat < 0) return LOG_RTERR (pctxt, stat);

            rtxDListAppend (pctxt, &pvalue->relatedExchangeId_list
               , (void*)pdata1);

            stat = rtXmlpGetNextElemID (pctxt, elemtab + 5, 1, -1, FALSE);
            if (stat < 0 && stat != RTERR_UNEXPELEM)
               return LOG_RTERR (pctxt, stat);
         }
         while (stat == 5);

         rtXmlpMarkLastEventActive (pctxt);
         stat = 0;
         break;
      }
      case 6: { /* issuerName */
         stat = rtXmlpDecDynUTF8Str (pctxt, &pvalue->issuerName);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.issuerNamePresent = TRUE;
         break;
      }
      case 7: { /* couponRate */
         stat = rtXmlpDecDouble (pctxt, &pvalue->couponRate, -1, -1);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.couponRatePresent = TRUE;
         break;
      }
      case 8: { /* maturity */
         stat = rtXmlpDecDynUTF8Str (pctxt, (const OSUTF8CHAR**)&pvalue->
            maturity);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.maturityPresent = TRUE;
         break;
      }
      case 9: { /* parValue */
         stat = rtXmlpDecDouble (pctxt, &pvalue->parValue, -1, -1);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.parValuePresent = TRUE;
         break;
      }
      case 10: { /* faceAmount */
         stat = rtXmlpDecDouble (pctxt, &pvalue->faceAmount, -1, -1);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.faceAmountPresent = TRUE;
         break;
      }
      case 11: { /* underlyingEquity */
         stat = XmlDec_UnderlyingAsset_derivations (pctxt, &pvalue->
            underlyingEquity);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

