{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("bond"), 4}, 0}, 0 },
      {{{OSUTF8("convertibleBond"), 15}, 0}, 0 },
      {{{OSUTF8("equity"), 6}, 0}, 0 },
      {{{OSUTF8("exchangeTradedFund"), 18}, 0}, 0 },
      {{{OSUTF8("future"), 6}, 0}, 0 },
      {{{OSUTF8("index"), 5}, 0}, 0 },
      {{{OSUTF8("mutualFund"), 10}, 0}, 0 },
      {{{OSUTF8("openUnits"), 9}, 0}, 1 },
      {{{OSUTF8("dividendPayout"), 14}, 0}, 2 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 7, -1}, {7, 2, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 3; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: { /*  */
         stat = XmlDec_UnderlyingAsset_group (pctxt, &pvalue->underlyingAsset
            );
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 1: { /* openUnits */
         stat = rtXmlpDecDouble (pctxt, &pvalue->openUnits, -1, -1);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.openUnitsPresent = TRUE;
         break;
      }
      case 2: { /* dividendPayout */
         stat = XmlDec_DividendPayout (pctxt, &pvalue->dividendPayout);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.dividendPayoutPresent = TRUE;
         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

