               rtxErrAddStrParm (pctxt, "Price_sequence_fxConversion.u.fxRate_list.count");
               rtxErrAddIntParm (pctxt, (int)pvalue->u.fxRate_list->count);
               return LOG_RTERR (pctxt, RTERR_CONSVIO);
