int XmlDec_GeneralTerms (OSCTXT* pctxt, GeneralTerms* pvalue)
{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("effectiveDate"), 13}, 0}, 0 },
      {{{OSUTF8("scheduledTerminationDate"), 24}, 0}, 1 },
      {{{OSUTF8("sellerPartyReference"), 20}, 0}, 2 },
      {{{OSUTF8("buyerPartyReference"), 19}, 0}, 3 },
      {{{OSUTF8("dateAdjustments"), 15}, 0}, 4 },
      {{{OSUTF8("referenceInformation"), 20}, 0}, 5 },
      {{{OSUTF8("additionalTerm"), 14}, 0}, 6 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 1, -1}, {1, 1, -1}, {2, 1, -1}, {3, 1, -1}, {4, 2, -1}
      , {6, 1, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 7; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: { /* effectiveDate */
         stat = XmlDec_AdjustableDate2 (pctxt, &pvalue->effectiveDate);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 1: { /* scheduledTerminationDate */
         stat = XmlDec_ScheduledTerminationDate (pctxt, &pvalue->
            scheduledTerminationDate);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 2: { /* sellerPartyReference */
         stat = XmlDec_PartyReference (pctxt, &pvalue->sellerPartyReference);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 3: { /* buyerPartyReference */
         stat = XmlDec_PartyReference (pctxt, &pvalue->buyerPartyReference);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 4: { /* dateAdjustments */
         stat = XmlDec_BusinessDayAdjustments (pctxt, &pvalue->dateAdjustments
            );
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.dateAdjustmentsPresent = TRUE;
         break;
      }
      case 5: { /* referenceInformation */
         stat = XmlDec_ReferenceInformation (pctxt, &pvalue->
            referenceInformation);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 6: {
         AdditionalTerm* pdata1;
         do {
            pdata1 = rtxMemAllocType (pctxt, AdditionalTerm);

            if (pdata1 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_AdditionalTerm (pdata1);

            stat = XmlDec_AdditionalTerm (pctxt, pdata1);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = rtXmlpMatchEndTag (pctxt, -1);
            if (stat < 0) return LOG_RTERR (pctxt, stat);

            rtxDListAppend (pctxt, &pvalue->additionalTerm_list
               , (void*)pdata1);

            stat = rtXmlpGetNextElemID (pctxt, elemtab + 6, 1, -1, FALSE);
            if (stat < 0 && stat != RTERR_UNEXPELEM)
               return LOG_RTERR (pctxt, stat);
         }
         while (stat == 6);

         rtXmlpMarkLastEventActive (pctxt);
         stat = 0;
         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

