int XmlDec_Trade (OSCTXT* pctxt, Trade* pvalue)
{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   /* decode attributes */
   if (rtXmlpHasAttributes (pctxt)) {
      static const OSXMLAttrDescr attrNames[] = {
         { {OSUTF8("id"), 2}, 0 }
      } ;
      OSUINT32 attrPresent[1];
      size_t i, nAttrs = 0;
      OSXMLNameFragments attrName;
      int tabidx;

      memset (attrPresent, 0, sizeof(attrPresent));

      stat = rtXmlpGetAttributeCount (pctxt);
      if (stat < 0) return LOG_RTERR (pctxt, stat);
      else nAttrs = (size_t)stat;

      for (i = 0; i < nAttrs; i++) {
         if (rtXmlpSelectAttribute (pctxt, &attrName, i) != 0) continue;
         tabidx = rtXmlpGetAttributeID (pctxt, 
            &attrName.mLocalName, 1, attrNames, attrPresent);

         switch (tabidx) {
         case 0: /* id */
            stat = rtXmlpDecDynUTF8Str (pctxt, &pvalue->id);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.idPresent = TRUE;
            break;

         default:
            stat = rtXmlpDecXSIAttr (pctxt, &attrName);
            if (stat != 0) {
               rtxErrAddStrParm (pctxt, "Trade");
               rtxErrAddStrnParm (pctxt, (const char*)attrName.mQName.value, 
                  attrName.mQName.length);
               LOG_RTERRNEW (pctxt, RTERR_INVATTR);
               stat = 0;
            }
         }
         if (stat < 0) {
            rtxErrAddStrParm (pctxt, "Trade");
            rtxErrAddStrnParm (pctxt, (const char*)attrName.mQName.value, 
               attrName.mQName.length);
            LOG_RTERRNEW (pctxt, RTERR_DECATTRFAIL);
            stat = 0;
         }
      }
   }

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("tradeHeader"), 11}, 0}, 0 },
      {{{OSUTF8("strategy"), 8}, 0}, 1 },
      {{{OSUTF8("fxAverageRateOption"), 19}, 0}, 1 },
      {{{OSUTF8("fxBarrierOption"), 15}, 0}, 1 },
      {{{OSUTF8("fxDigitalOption"), 15}, 0}, 1 },
      {{{OSUTF8("fxSimpleOption"), 14}, 0}, 1 },
      {{{OSUTF8("fxSingleLeg"), 11}, 0}, 1 },
      {{{OSUTF8("fxSwap"), 6}, 0}, 1 },
      {{{OSUTF8("termDeposit"), 11}, 0}, 1 },
      {{{OSUTF8("bulletPayment"), 13}, 0}, 1 },
      {{{OSUTF8("capFloor"), 8}, 0}, 1 },
      {{{OSUTF8("fra"), 3}, 0}, 1 },
      {{{OSUTF8("swap"), 4}, 0}, 1 },
      {{{OSUTF8("swaption"), 8}, 0}, 1 },
      {{{OSUTF8("equityOption"), 12}, 0}, 1 },
      {{{OSUTF8("equitySwap"), 10}, 0}, 1 },
      {{{OSUTF8("creditDefaultSwap"), 17}, 0}, 1 },
      {{{OSUTF8("otherPartyPayment"), 17}, 0}, 2 },
      {{{OSUTF8("brokerPartyReference"), 20}, 0}, 3 },
      {{{OSUTF8("calculationAgent"), 16}, 0}, 4 },
      {{{OSUTF8("calculationAgentBusinessCenter"), 30}, 0}, 5 },
      {{{OSUTF8("documentation"), 13}, 0}, 6 },
      {{{OSUTF8("governingLaw"), 12}, 0}, 7 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 1, -1}, {1, 16, -1}, {17, 6, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 8; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: { /* tradeHeader */
         stat = XmlDec_TradeHeader (pctxt, &pvalue->tradeHeader);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 1: { /*  */
         stat = XmlDec_Product_group (pctxt, &pvalue->product);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         break;
      }
      case 2: {
         Payment* pdata1;
         do {
            pdata1 = rtxMemAllocType (pctxt, Payment);

            if (pdata1 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_Payment (pdata1);

            stat = XmlDec_Payment (pctxt, pdata1);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = rtXmlpMatchEndTag (pctxt, -1);
            if (stat < 0) return LOG_RTERR (pctxt, stat);

            rtxDListAppend (pctxt, &pvalue->otherPartyPayment_list
               , (void*)pdata1);

            stat = rtXmlpGetNextElemID (pctxt, elemtab + 17, 1, -1, FALSE);
            if (stat < 0 && stat != RTERR_UNEXPELEM)
               return LOG_RTERR (pctxt, stat);
         }
         while (stat == 2);

         rtXmlpMarkLastEventActive (pctxt);
         stat = 0;
         break;
      }
      case 3: {
         PartyReference* pdata1;
         do {
            pdata1 = rtxMemAllocType (pctxt, PartyReference);

            if (pdata1 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_PartyReference (pdata1);

            stat = XmlDec_PartyReference (pctxt, pdata1);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            stat = rtXmlpMatchEndTag (pctxt, -1);
            if (stat < 0) return LOG_RTERR (pctxt, stat);

            rtxDListAppend (pctxt, &pvalue->brokerPartyReference_list
               , (void*)pdata1);

            stat = rtXmlpGetNextElemID (pctxt, elemtab + 18, 1, -1, FALSE);
            if (stat < 0 && stat != RTERR_UNEXPELEM)
               return LOG_RTERR (pctxt, stat);
         }
         while (stat == 3);

         rtXmlpMarkLastEventActive (pctxt);
         stat = 0;
         break;
      }
      case 4: { /* calculationAgent */
         stat = XmlDec_CalculationAgent (pctxt, &pvalue->calculationAgent);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.calculationAgentPresent = TRUE;
         break;
      }
      case 5: { /* calculationAgentBusinessCenter */
         stat = XmlDec_BusinessCenter (pctxt, &pvalue->
            calculationAgentBusinessCenter);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.calculationAgentBusinessCenterPresent = TRUE;
         break;
      }
      case 6: { /* documentation */
         stat = XmlDec_Documentation (pctxt, &pvalue->documentation);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.documentationPresent = TRUE;
         break;
      }
      case 7: { /* governingLaw */
         stat = XmlDec_GoverningLaw (pctxt, &pvalue->governingLaw);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.governingLawPresent = TRUE;
         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

