                  rtxErrAddStrParm (pctxt, "TradeStatus.tradeStatusItem_list.count");
                  rtxErrAddIntParm (pctxt, (int)pvalue->tradeStatusItem_list.count);
                  return LOG_RTERR (pctxt, RTERR_CONSVIO);
