         if (pvalue->u.swaption == NULL)
            return LOG_RTERR (pctxt, RTERR_NOMEM);

         asn1Init_Swaption (pvalue->u.swaption);
         stat = asn1D_Swaption (pctxt, 
            pvalue->u.swaption, ASN1IMPL, length);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         pvalue->t = 13;
