         if (pvalue->u.equitySwap == NULL)
            return LOG_RTERR (pctxt, RTERR_NOMEM);

         asn1Init_EquitySwap (pvalue->u.equitySwap);
         stat = asn1D_EquitySwap (pctxt, 
            pvalue->u.equitySwap, ASN1IMPL, length);
